import React from 'react'
import { useAuth } from '../../hooks/UseAuth';
import classes from "./dashboard.module.css"
import { Link } from 'react-router-dom';

const Dashboard = () => {
    const { user } = useAuth();
  return (
    <div className={classes.container}>
       <div className={classes.menu}>
          {
          allItems.filter(item => item.forAdmin || !item.forAdmin)
          .map(item => <Link to={item.url} style={{backgroundColor: item.bgColour, color: item.color}}></Link>)
          }
       </div>
    </div>
  )
}

export default Dashboard

const allItems =[
    {
        title: 'Orders',
        imageUrl: '/icons/orders.svg',
        url: '/orders',
        bgColour: '#ec407a',
        color: 'white',
    },
    {
        title: 'Foods',
        imageUrl: '/icons/foods.svg',
        url: '/admin/foods',
        forAdmin: true,
        bgColour: '#e040fb',
        color: 'white',
    },
]
